    // URL Google Apps Script Web App
    const SCRIPT_URL = "https://script.google.com/macros/s/AKfycbx2XcVRJRK_emaW05aA2RUABQ4GCqPGPvUl_PB3qhRjAlpVIxZCs0ngfgWf57jfRCY/exec";

    // Hàm gửi dữ liệu về Google Sheet
    function sendResultToSheet(name, score, answers) {
      fetch(SCRIPT_URL, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({
          name: name,
          score: score,
          answers: answers,
          timestamp: new Date().toISOString()
        })
      })
      .then(res => console.log("Đã gửi kết quả:", res))
      .catch(err => console.error("Lỗi khi gửi:", err));
    }

    // Khởi động quiz iSpring
    QuizPlayer.start("content", "rrquoakrf404-m2ckbnxb80ys", data, 1, "https://s4.ispringsolutions.com", false, true, "always", function(player) {
      // Khi quiz load xong → bỏ preloader
      player.initializationCompleteEvent().addHandler(function() {
        var preloader = document.getElementById("preloader");
        if (preloader) preloader.parentNode.removeChild(preloader);
      });

      // 👉 Lắng nghe sự kiện khi học sinh hoàn thành quiz
      player.submitResultsEvent().addHandler(function(results) {
        console.log("Kết quả quiz:", results);

        // Lấy tên người dùng (nếu quiz có phần nhập tên, nếu không thì để Anonymous)
        const name = results.userName || "Anonymous";

        // Lấy điểm
        const score = results.score;

        // Lấy đáp án (object của iSpring)
        const answers = results.answers;

        // Gửi về Google Sheet
        sendResultToSheet(name, score, answers);
		
      });
    });
